      SELECT DISTINCT ( + + CASE - COUNT ( * ) WHEN 22 THEN NULL WHEN + ( + 23 ) - + - 0 / + CAST ( - COUNT ( * ) AS REAL ) / + 5 THEN - ( COUNT ( * ) ) ELSE NULL END ) * + NULLIF ( + + 60, - 91 * 89 ) AS col0;

outputs:
  - name: q64.out
    data: |
      NULL
